<!DOCTYPE html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.04444;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(69.864919, 49.462333);
			ctx.lineTo(4.999097, 49.499922);
			ctx.stroke();

			// #path1
			ctx.beginPath();
			ctx.fillStyle = "rgb(0, 0, 0)";
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(65.093254, 39.274964);
			ctx.lineTo(95.111462, 49.618321);
			ctx.lineTo(65.302406, 59.70664);
			ctx.bezierCurveTo(
				71.701267,
				49.930094,
				72.023349,
				49.516969,
				65.093254,
				39.274964,
			);
			ctx.closePath();
			ctx.fill();
			ctx.stroke();
		</script>
	</body>
</html>
